// Fonction pour calculer la similarité cosinus
function cosineSimilarity(vec1, vec2) {
    let dotProduct = 0;
    let norm1 = 0;
    let norm2 = 0;
    
    for (let i = 0; i < vec1.length; i++) {
        dotProduct += vec1[i] * vec2[i];
        norm1 += vec1[i] * vec1[i];
        norm2 += vec2[i] * vec2[i];
    }
    
    return dotProduct / (Math.sqrt(norm1) * Math.sqrt(norm2));
}

// Fonction pour trouver les mots les plus proches
function findNearestWords(word, n = 5) {
    if (!embeddings[word]) {
        return [];
    }
    
    const targetVec = embeddings[word];
    const similarities = [];
    
    for (const [w, vec] of Object.entries(embeddings)) {
        if (w !== word) {
            similarities.push({
                word: w,
                similarity: cosineSimilarity(targetVec, vec)
            });
        }
    }
    
    similarities.sort((a, b) => b.similarity - a.similarity);
    return similarities.slice(0, n);
}

// Fonction pour les analogies (king - man + woman = queen)
function findAnalogy(wordA, wordB, wordC) {
    if (!embeddings[wordA] || !embeddings[wordB] || !embeddings[wordC]) {
        return null;
    }
    
    // Calculer : vec(B) - vec(A) + vec(C)
    const result = [];
    for (let i = 0; i < embeddings[wordA].length; i++) {
        result.push(embeddings[wordB][i] - embeddings[wordA][i] + embeddings[wordC][i]);
    }
    
    // Trouver le mot le plus proche du résultat
    let bestWord = null;
    let bestSim = -1;
    
    for (const [word, vec] of Object.entries(embeddings)) {
        if (word !== wordA && word !== wordB && word !== wordC) {
            const sim = cosineSimilarity(result, vec);
            if (sim > bestSim) {
                bestSim = sim;
                bestWord = word;
            }
        }
    }
    
    return { word: bestWord, similarity: bestSim };
}

